import React from "react";
import { motion } from "framer-motion";
const DashBoard = () => {
  return <>
      <div className="container">
      <motion.p
        initial={{ opacity: 0, x: -100 }} // Initial state: hidden and shifted to the left
        animate={{ opacity: 1, x: 0 }}     // Animation state: visible and centered
        transition={{ duration: 1 }}       // Smooth transition duration
        className="display-5"
      >
        Welcome to the Ghazi Fabrics Admin Dashboard
      </motion.p>
      ></div>
  </>;
};

export default DashBoard;
